import React from "react";
import nbaImage from "../assets/nba-logo.png";

const Header = ({ name }) => {
  // console.log(name);
  return (
    <>
      <div className="nba-image">
        <img src={nbaImage} alt="" />
      </div>
      <div>
        <h1>NBA Le</h1>
      </div>
    </>
  );
};

export default Header;
